import React from "react";
function Header(){
    let title={
        Desinger:'desing ',
        Programmer:'program '

    }
    const client = 'Designer';
    let info={
        name:'eman',
        nick:'feah'
    }
    return(

    <div className='navbar bg-dark rounded text-white'>
        Hello {`${info.name} {info.nick`}
    <h1 className='text-white'>{client=='Designer' ? title.Desinger :title.Programmer }
      is my life
     </h1>
    </div>
    );

}
export default Header;
